import Matrix
import Data.List

type Image = Matrix Int

--instance Show Image where
--    show img = rowfold (\p acc -> (if p then '*' else '.'):acc) "" img

display :: Image -> String
display img = b ++ "\n" ++ intercalate "\n" r ++ "\n" ++ b ++ "\n" where 
    r = rowfold (\p acc -> (pixel p) ++ acc) "" img
    b = replicate ((cols img)*2) '-'
    pixel p 
        | p <= 51     = "██"
        | p <= 102    = "▓▓"
        | p <= 153    = "▒▒"
        | p <= 204    = "░░"
        | otherwise   = "  "

blank :: Int -> Int -> Image
blank n m = create (replicate n (replicate m 0))

fromList :: [[Int]] -> Image
fromList a = create a

-- main = putStr $ display (fromList shai)

generate :: (Int -> Int -> Int) -> Int -> Int -> Image
generate f rows cols = fromList $ map calcRow [0..(rows-1)] where
    calcRow x = map (f x) [0..(cols-1)]

invert :: Image -> Image
invert = fmap (\x -> 255-x)

rectAbout :: Image -> (Int, Int) -> Int -> Image
rectAbout i (x, y) r = subMat i (x-r, y-r) (x+r, y+r)

quantize :: Image -> Int -> Image
quantize i s = fmap q i where
    q 255 = 255
    q n = ((n - (n `mod` (255 `div` s))) * s) `div` (s-1) `mod` 256

laplacian :: Image -> Image
laplacian i = generate f (rows i) (cols i) where
    f x y =  abs (avg - (get i (x,y))) where
        avg     = (fold (\acc x -> acc + x) 0 m) `div` (rows m * cols m) where
            m   = rectAbout i (x,y) 1

threshold :: Int -> Image -> Image
threshold n = fmap (\x -> if (x<n) then 0 else 255)

normalize :: Matrix Float -> Matrix Float 
normalize ker = fmap (/sumMat) ker where
                sumMat = fold (+) 0 ker
            

convolve :: Matrix Float -> Image -> Image 
convolve ker im =  generate f (rows im) (cols im) where
    f x y = floor . abs $  fold (+) 0 (filterMult (ker) (fmap fromIntegral im) (x,y)) where  

 
